import React from 'react';

import styles from './Product.module.css';
import Button from '../../UI/Button/Button';

function product(props) {
  let product = '';
  console.log(props.priceTable);
  if(props.priceTable) {
    product = (
      <table>
        <tbody>
          <tr>
            <th>ss</th>
            <th>Lastname</th> 
            <th>Age</th>
          </tr>
          <tr>
            <td>ss</td>
            <td>Smith</td> 
            <td>50</td>
          </tr>
          <tr>
            <td>ss</td>
            <td>Jackson</td> 
            <td>94</td>
          </tr>
        </tbody>
      </table>)
  } else {
    product = (<Button type='button'>Подробнее</Button>)
  }
  return (
    <div className={styles.product}>
        <img src={props.url} alt='test' />
        <h3>{props.caption}</h3>
        <p>{props.desc}</p>
        {product}
    </div>
  )
}

export default product
